package turniplabs.industry.blockimport net.minecraft.src.BlockSaplingBaseimport net.minecraft.src.Worldimport net.minecraft.src.WorldGenTreeShapeDefaultimport net.minecraft.src.WorldGeneratorimport java.util.*class BlockSaplingRubber(i: Int) : BlockSaplingBase(i) {    override fun growTree(world: World?, x: Int, y: Int, z: Int, random: Random?) {        val obj: WorldGenerator? = null        world?.setBlock(x, y, z, 0)        val tree = WorldGenTreeShapeDefault(IndustryBlocks.RUBBER_LEAVES.blockID, IndustryBlocks.RUBBER_LOG.blockID, 8)        if (!tree.generate(world, random, x, y, z))            world?.setBlock(x, y, z, this.blockID)    }}